import React from 'react'
import Data from './Data'

class MaineContent extends React.Component {
    constructor(){
        super()
        this.state={
            data: Data.map(items =>
                <div>
                    <div className="product col-sm-6 col-md-4 col-lg-3"><div className="well">3<br/>product</div></div>
                </div> )
        }
    }
    render() {
     return(
         <div className="row">
             {this.state.data}
         </div>
        )
    }

}

export default MaineContent
